package newprj0305;

public class P1of2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int temp = (int)'A';
		System.out.println(temp);
		
		temp++;
		System.out.println(temp);
		
		char temp2 = (char)97;
		System.out.println(temp2);
		
		int temp3 = (int)'z';
		System.out.println(temp3);
		
		for (int i=97; i<123; i++) {
			char tempi = (char)i;
			System.out.print(tempi);
		}
	}
}
